import React from 'react';
import DeleteForeverIcon from '@material-ui/icons/Delete';
import Button from '@material-ui/core/Button';
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';
const Note = () =>{
    return (
        <>
        <div className="note">
            <h1>Title</h1>
            <p>This is the content</p>
            <Button>
                <DeleteForeverIcon/>
            </Button>
        </div>
        </>
    )
}
export default Note;
